No development shall commence in a Phase, including any works of demolition in Phase 2, until the following details for that Phase have been submitted in writing to the Local Planning Authority: 

a. The proposed construction programme;

b. Notification of the appointed contractor for the development and the liaison officer for the contractor responsible for liaising with the London Borough of Barking and Dagenham (LBBD) as local employment brokers on any local recruitment and supplies opportunities arising from the development;

c. Notification of any recruitment and supplies opportunities arising from the proposed development in order to allow LBBD as local employment broker to notify local recruitment and training agencies and put forward any relevant candidates prior to the contractor undertaking any other advertising. 

The developer (through its appointed contractor) shall ensure that local employment is a criteria during the initial screening of candidates for employment arising from the development and for the matching of candidates to any vacancies and the appointed contractor will interview and, if appropriate, recruit suitably qualified applicants put forward by LBBD as local recruitment broker. 

Reason:  To maximise job opportunities for people living in the local community in accordance with policy CC3 of the Core Strategy.

No development shall commence in a Phase, including any works of demolition in Phase 2, until a Construction Environmental Management Plan (CEMP) and a Site Waste Management Plan (SWMP) for that Phase have been submitted to and approved in writing by the Local Planning Authority.  These plans shall incorporate details of:

- construction traffic management;
- the parking of vehicles of site operatives and visitors; 
- loading and unloading of plant and materials; 
- storage of plant and materials used in constructing the development; 
- the erection and maintenance of security hoarding(s) including decorative displays and facilities for public viewing, where appropriate; 
- wheel washing facilities;
- measures to control the emission of dust and dirt during construction; 
- a scheme for recycling/disposing of waste resulting from demolition and construction works;
- the use of efficient construction materials;
- methods to minimise waste, to encourage re-use, recovery and recycling, and sourcing of materials; and
- a nominated Developer/Resident Liaison Representative with an address and contact telephone number to be circulated to those residents consulted on the application by the developer's representatives.  This person will act as first point of contact for residents who have any problems or questions related to the ongoing development.

Once approved these plans shall be adhered to throughout the construction period.

Reason:  In order to reduce the environmental impact of the construction and the impact on the amenities of neighbouring residents and in accordance with policy BP8 of the Borough Wide Development Policies DPD.

No development shall commence in a Phase until a detailed surface water drainage scheme for that Phase, based on the agreed Flood Risk Assessment (FRA) (The Leys, Dagenham, March 2013 compiled by Peter Brett Associates LLP, Doc. Ref: 28149-005, Issue 2 18.03.13) and drawings:

- The Leys, Dagenham - Phase 1- Proposed Drainage (28149-C-520 Rev. P2); 

- The Leys, Dagenham - Phase 2 - Proposed Drainage (28149-C-530 Rev. P2); 

has been submitted to and approved in writing by the Local Planning Authority.  The scheme shall subsequently be implemented in accordance with the approved details before the development is completed.  The scheme shall include a restriction in run-off and surface water storage on site as outlined in the FRA.

Reason:  To prevent the increased risk of flooding, to improve and protect water quality and to improve habitat and amenity in accordance with policy CR4 of the Core Strategy, policy BR4 of the Borough Wide Development Policies DPD and policy 5.13 of the London Plan.

No development shall commence in a Phase until an investigation and risk assessment for that Phase, in addition to any assessment provided with the planning application, has been completed in accordance with a scheme to assess the nature and extent of any contamination on the site, whether or not it originates on the site.  The contents of the scheme are subject to the approval in writing of the Local Planning Authority.  The investigation and risk assessment must be undertaken by competent persons and a written report of the findings must be produced.  The written report is subject to the approval in writing of the Local Planning Authority.  The report of the findings must include:

(i)  a survey of the extent, scale and nature of contamination;

(ii)  an assessment of the potential risks to:

- human health; 
- property (existing or proposed) including buildings, crops, livestock, pets, woodland and service lines and pipes; 
- adjoining land; 
- groundwaters and surface waters; 
- ecological systems; 
- archaeological sites and ancient monuments;

(iii)  an appraisal of remedial options, and proposal of the preferred option(s). 

This must be conducted in accordance with DEFRA and the Environment Agency's 'Model Procedures for the Management of Land Contamination, CLR 11'.
